import React from 'react';
import {Form, Button} from "react-bootstrap";
import {Link, Route} from "react-router-dom";
import Sales from "./Sales";
import LineGraph from "./graphComponents/LineGraph";
import BarGraph from "./graphComponents/BarGraph";
import scatterplotGraph from "./graphComponents/scatterplotGraph";
import PieGraph from "./graphComponents/PieGraph";


const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "750px",
    height: "600px",
    marginLeft: "50px",
    marginTop: "30px",
    alignContent: "center"
}

const newblock2 = {
    backgroundColor: "yellow",
    borderRadius: "50px",
    display: "block",
    width: "750px",
    height: "600px",
    marginLeft: "50px",
    marginTop: "500px",
    alignContent: "center"
}

const dataRoute = [
    { path: '/lineDisplay',
        main: () =>  <LineGraph name = "hello line"/>
    },
    {
        path: '/barDisplay',
        main: () => <BarGraph name = "hello bar"/>
    },
    {
        path: '/pieDisplay',
        main: () => <PieGraph name = "hello pie"/>
    },
    {
        path: '/scatterDisplay',
        main: () => <scatterplotGraph name = "hello scatter"/>
    }
]

export default class GraphForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            fileName: "",
            graphType: "",
            predFrequency: "",
            numPred: 0
        }
        this.handleChange = this.handleChange.bind(this)
        this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleChange(event) {
        this.setState({ [event.target.name]: event.target.value })
    }

    handleSubmit(event) {
        event.preventDefault()
    }

    render() {
        return(<text></text>
        );
    }
}
